% 第一步的策略是一个很差的策略，导致价值函数并不是单调的。
% 通常，不论是值迭代还是策略迭代，其前几步都不是按照指数收敛的。
%%
%[text] ## MC Exploring Starts
% MC Exploring Starts 算法实现

% 初始化参数
episode_count = 1000;  % 总回合数
Tlength = 30;  % 最大回合长度
gamma = 0.9;

% 初始化数据结构
% 对于每个状态-动作对，记录回报和访问次数
Return = zeros(state_space, number_of_action);  % 累计回报
Number = zeros(state_space, number_of_action);  % 访问次数
Q = zeros(state_space, number_of_action);       % 动作价值函数

% 初始策略：均匀随机策略
policy = ones(state_space, number_of_action) * (1/number_of_action);

% 主循环
for episode = 1:episode_count %[output:group:706a7d37]
    % Exploring Starts: 随机选择起始状态-动作对
    % 确保所有状态-动作都可能被选中
    s0_idx = randi([1, state_space]);  % 随机选择起始状态
    a0_idx = randi([1, number_of_action]);  % 随机选择起始动作
    
    % 将一维状态索引转换为二维坐标
    s0_y = ceil(s0_idx/x_length);
    s0_x = s0_idx - (s0_y-1)*x_length;
    s0 = [s0_x, s0_y];
    
    % 获取起始动作
    start_action = actions{a0_idx};
    
    % 生成回合（从起始状态-动作开始，然后按照当前策略进行）
    episode_states = zeros(Tlength, 2);
    episode_actions = zeros(Tlength, 1);
    episode_rewards = zeros(Tlength, 1);
    
    % 第一步：使用起始状态-动作
    current_state = s0;
    current_action_idx = a0_idx;
    
    for t = 1:Tlength
        % 记录当前状态和动作
        episode_states(t, :) = current_state;
        episode_actions(t) = current_action_idx;
        
        % 执行动作，获取奖励和下一个状态
        [next_state, reward] = next_state_and_reward(current_state, ...
            actions{current_action_idx}, x_length, y_length, ...
            final_state, obstacle_state, reward_forbidden, reward_target, reward_step);
        
        % 记录奖励
        episode_rewards(t) = reward;
        
        % 检查是否到达终止状态
        if isequal(next_state, final_state) || ...
           ismember(next_state, obstacle_state, 'rows')
            % 到达终止状态或障碍物，结束回合
            episode_length = t;
            break;
        end
        
        % 按照当前策略选择下一个动作
        state_1d = x_length * (next_state(2)-1) + next_state(1);
        current_action_idx = randsrc(1, 1, [1:number_of_action; policy(state_1d, :)]);
        current_state = next_state;
        
        if t == Tlength
            episode_length = Tlength;
        end
    end
    
    % 初始化累积回报
    G = 0;
    
    % 反向遍历回合中的每一步（首次访问型MC）
    visited_pairs = zeros(state_space, number_of_action);  % 标记是否已访问
    
    for t = episode_length:-1:1
        % 获取当前状态和动作
        current_state = episode_states(t, :);
        current_action_idx = episode_actions(t);
        
        % 将状态转换为索引
        state_1d = x_length * (current_state(2)-1) + current_state(1);
        
        % 首次访问型：如果这个状态-动作对在当前回合中还没有被访问过
        if visited_pairs(state_1d, current_action_idx) == 0
            % 标记为已访问
            visited_pairs(state_1d, current_action_idx) = 1;
            
            % 更新累积回报
            G = gamma * G + episode_rewards(t);
            
            % 更新Return和Number
            Return(state_1d, current_action_idx) = Return(state_1d, current_action_idx) + G;
            Number(state_1d, current_action_idx) = Number(state_1d, current_action_idx) + 1;
            
            % 策略评价：更新Q值
            Q(state_1d, current_action_idx) = Return(state_1d, current_action_idx) / ...
                Number(state_1d, current_action_idx);
            
            % 策略改进：贪婪策略
            % 找到当前状态下具有最大Q值的动作
            [max_q, max_action_idx] = max(Q(state_1d, :));
            
            % 设置确定性策略
            policy(state_1d, :) = 0;
            policy(state_1d, max_action_idx) = 1;
        else
            % 非首次访问，只更新累积回报（不更新Q值）
            G = gamma * G + episode_rewards(t);
        end
    end
    
    % 每100个回合显示一次进度
    if mod(episode, 100) == 0
        fprintf('Episode %d/%d completed\n', episode, episode_count); %[output:8bad6f97] %[output:318d69b5] %[output:1b857df3] %[output:7070909d] %[output:4721eb8a] %[output:515944b5] %[output:011f9ab9] %[output:56ab0566] %[output:566fb4f7] %[output:8ce60813]
        
        % 计算并显示策略性能
        success_count = 0;
        test_episodes = 100;
        
        for test = 1:test_episodes
            % 从随机状态开始
            test_state_idx = randi([1, state_space]);
            test_state_y = ceil(test_state_idx/x_length);
            test_state_x = test_state_idx - (test_state_y-1)*x_length;
            test_state = [test_state_x, test_state_y];
            
            % 执行策略直到终止
            for step = 1:Tlength
                % 选择动作
                test_action_idx = randsrc(1, 1, [1:number_of_action; policy(test_state_idx, :)]);
                
                % 执行动作
                [next_state, reward] = next_state_and_reward(test_state, ...
                    actions{test_action_idx}, x_length, y_length, ...
                    final_state, obstacle_state, reward_forbidden, reward_target, reward_step);
                
                % 检查是否到达目标
                if isequal(next_state, final_state)
                    success_count = success_count + 1;
                    break;
                end
                
                % 更新状态
                test_state = next_state;
                test_state_idx = x_length * (test_state(2)-1) + test_state(1);
                
                % 检查是否陷入障碍物
                if ismember(test_state, obstacle_state, 'rows')
                    break;
                end
            end
        end
        
        success_rate = success_count / test_episodes * 100;
        fprintf('  Success rate: %.1f%%\n', success_rate); %[output:09bfabb0] %[output:8a0d06df] %[output:1c9d100d] %[output:71023468] %[output:120977ae] %[output:5d32f3dd] %[output:11626a2f] %[output:9aabaf60] %[output:2d970e10] %[output:23a1420c]
    end
end %[output:group:706a7d37]

